import React from 'react';
import { Formik, Form, Field, FieldArray } from 'formik';

const initialValues = {
  applicable_items: [],
  applied_to: 'some',
  name: '',
  rate: 0,
  categories: [
    {
      name: 'Category A',
      items: [
        { id: 14867, label: 'Item 1' },
        { id: 14869, label: 'Item 2' }
      ]
    },
    {
      name: 'Category B',
      items: [
        { id: 14870, label: 'Item 3' }
      ]
    },
    {
      name: 'Uncategorized',
      items: [
        { id: 14872, label: 'Item 4' },
        { id: 14873, label: 'Item 5' },
        { id: 14865, label: 'Item 6' }
      ]
    }
  ]
};

const TaxForm = () => {
  const handleSubmit = (values) => {
    console.log(values);
  };

  return (
    <Formik initialValues={initialValues} onSubmit={handleSubmit}>
      {({ values, setFieldValue }) => (
        <Form>
          <div>
            <label htmlFor="applied_to">Apply to items</label>
            <Field as="select" id="applied_to" name="applied_to" 
              onChange={(e) => {
                const value = e.target.value;
                setFieldValue("applied_to", value);
                if (value === 'all') {
                  const allItems = values.categories
                    .reduce((acc, category) => [...acc, ...category.items], [])
                    .map(item => item.id);
                  setFieldValue('applicable_items', allItems);
                } else {
                  setFieldValue('applicable_items', []);
                }
              }}
            >
              <option value="some">Some</option>
              <option value="all">All</option>
            </Field>
          </div>

          {values.applied_to === 'some' && (
            <FieldArray name="applicable_items">
              {({ push, remove }) => (
                <>
                  {values.categories.map((category, idx) => (
                    <div key={idx}>
                      <label>
                        <Field
                          type="checkbox"
                          name="category"
                          onChange={(e) => {
                            const isChecked = e.target.checked;
                            category.items.forEach(item => {
                              if (isChecked) {
                                if (!values.applicable_items.includes(item.id)) {
                                  push(item.id);
                                }
                              } else {
                                const index = values.applicable_items.indexOf(item.id);
                                if (index !== -1) {
                                  remove(index);
                                }
                              }
                            });
                          }}
                        />
                        {category.name}
                      </label>

                      <div style={{ paddingLeft: '20px' }}>
                        {category.items.map((item) => (
                          <div key={item.id}>
                            <label>
                              <Field
                                type="checkbox"
                                name="applicable_items"
                                value={item.id}
                                checked={values.applicable_items.includes(item.id)}
                                onChange={(e) => {
                                  if (e.target.checked) {
                                    push(item.id);
                                  } else {
                                    const index = values.applicable_items.indexOf(item.id);
                                    if (index !== -1) {
                                      remove(index);
                                    }
                                  }
                                }}
                              />
                              {item.label}
                            </label>
                          </div>
                        ))}
                      </div>
                    </div>
                  ))}
                </>
              )}
            </FieldArray>
          )}

          <div>
            <label htmlFor="name">Name</label>
            <Field id="name" name="name" />
          </div>
          <div>
            <label htmlFor="rate">Rate</label>
            <Field id="rate" name="rate" type="number" step="0.01" />
          </div>

          <button type="submit">Submit</button>
        </Form>
      )}
    </Formik>
  );
};

export default TaxForm;
